import React from 'react';
import styled from 'styled-components';
import { SearchOutlined } from '@mui/icons-material';
import Badge from '@mui/material/Badge';
import ShoppingCartOutlinedIcon from '@mui/icons-material/ShoppingCartOutlined';  


// Styling the MAIN COMPONENTS of the Navbar
const Container = styled.div`
    height: 60px;
    background-color: lightgray;
`;

const Wrapper = styled.div`
    padding: 10px 20px;
    display: flex;
    justify-content: space-between;
`;

// Styling the LEFT SIDE of the Navbar
const Left = styled.div`
    flex: 1;
`;

const Language = styled.span`
    font-size: 14px;
    ${'' /* cursor: pointer; */}
`;

const SearchContainer = styled.div``;

// Styling the CENTER SIDE of the Navbar
const Center = styled.div`
    flex: 1;
`;

const Title = styled.h1``;

// Styling the RIGHT SIDE of the Navbar
const Right = styled.div`
    flex: 1;
`;

const MenuItems = styled.div``;



function Navbar() {
  return (

    <Container>
        <Wrapper>

            {/* LEFT SIDE OF THE NAVBAR */}
            <Left>
                <Language>EN/LI</Language>
                <SearchContainer></SearchContainer>
            </Left>

            {/* CENTER SIDE OF THE NAVBAR */}
            <Center>
                <Title>CATE.</Title>
            </Center>

            {/* RIGHT SIDE OF THE NAVBAR */}
            <Right>
                <MenuItems>REGISTER</MenuItems>
                <MenuItems>LOG IN</MenuItems>
                <MenuItems>
                    <Badge badgeContent={2} color="primary"> <ShoppingCartOutlinedIcon /> </Badge>
                </MenuItems>
            </Right>

        </Wrapper>
    </Container>
  )
}

export default Navbar
